import React, { Component } from 'react';
import './Navbar.css';
import { Link } from 'react-router-dom'

export default class Navbar extends Component {
    componentDidMount() {}
  render() {
    return (
      <div>
        <div className="title">
          <h3>A N O T H E R <strong>C O D E P E N</strong></h3>
        </div>
        <div className="more-pens">
          <a target="_blank" href="https://codepen.io/plasm/" className="white-mode">VIEW OTHER PENS</a>
          <a target="_blank" href="https://codepen.io/collection/nZpPbz/" className="white-mode">VIEW OTHER PARTICLES</a>
        </div>
      </div>
    )
  }
}
